    def scc(nodes):
        visited = {x: False for x in nodes}
        parent = {x: None for x in nodes}

        def recurse(u):
            visited[u] = True

            for v in nodes:
                if not visited[v] and u!= v and u in G[v]:
                    parent[v] = u
                    recurse(v)

        for u in nodes:
            if not visited[u]:
                recurse(u)

        return parent

    def cycle(u, v):
        if u == v or parent[u] is None:
            return False

        if parent[u] == parent[v]:
            return True

        return cycle(u, parent[u]) or cycle(u, parent[v])

    # create adjacency list
    G = defaultdict(list)
    for u, v in edges:
        G[u].append(v)
        G[v].append(u)

    # find connected components
    parent = scc(range(n))
    components = set()
    for i in range(n):
        component = [i]
        p = parent[i]
        while p is not None:
            component.append(p)
            p = parent[p]
        component = frozenset(component)
        components.add(component)

    return str(len(components) - 1)


