                memo[i][j] = weight
            else:
                for node in adjacency_list[i]:
                    if j - weights[node] < 0:
                        memo[i][j] = max(memo[i][j], memo[node][j - weights[node]] + weight)
    max_weight = 0
    for i in range(n):
        if max_weight < memo[i][k]:
            max_weight = memo[i][k]
    return max_weight


