def solution(stdin: str) -> str:
    """
    The goal of this problem is to find the area of the white region within the
    rectangle after the end of the painting process.

    As mentioned above, there is a rectangle in the xy-plane, with its lower left corner
    at (0, 0) and its upper right corner at (W, H). Each of its sides is parallel to the
    x-axis or y-axis. Initially, the whole region within the rectangle is painted white.
    Snuke plotted N points into the rectangle. The coordinate of the i-th (1 ≦ i ≦ N) point
    was (x_i, y_i).
    Then, he created an integer sequence a of length N, and for each 1 ≦ i ≦ N, he painted
    some region within the rectangle black, as follows:
        - If a_i = 1, he painted the region satisfying x < x_i within the rectangle.
        - If a_i = 2, he painted the region satisfying x > x_i within the rectangle.
        - If a_i = 3, he painted the region satisfying y < y_i within the rectangle.
        - If a_i = 4, he painted the region satisfying y > y_i within the rectangle.

    Calculate the area of the white region within the rectangle after he finished painting.

    This is a straightforward greedy algorithm that does not belong to the class.
    """
    W, H, N = [int(x) for x in stdin.split()]

    x1, y1, a1 = [int(x) for x in stdin.split()]
    x2, y2, a2 = [int(x) for x in stdin.split()]

    # This function counts the number of black-regions within the rectangle.
    def count_black_regions(x1: int, y1: int, x2: int, y2: int) -> int:
        if x1 > x2 or y1 > y2:
            raise ValueError()

        # Use binary search to find the point of intersection.
        left, right = 0, W
        while left < right:
            mid = (left + right) // 2
            if (mid, 0) < (x1, y1):
                left = mid + 1
            elif (mid, 0) > (x2, y2):
                right = mid
            else:
                left = mid + 1

        # Count black-regions within the x-range.
        if (mid, 0) > (x1, y1):
            left = 0
        elif (mid, 0) < (x2, y2):
            left = 0
        else:
            left = mid + 1

        # Count black-regions within the y-range.
        if (mid, 0) > (x1, y1):
            right = 0
        elif (mid, 0) < (x2, y2):
            right = 0
        else:
            right = mid + 1

        # Count black-regions within the rectangle.
        left, right = mid, W
        while left < right:
            mid = (left + right) // 2
            if (mid, 0) < (x1, y1):
                left = mid + 1
            elif (mid, 0) > (x2, y2):
                right = mid
            else:
                left = mid + 1

        return left - mid

    # Count the white regions within the rectangle.
    left, right = 0, W
    while left < right:
        mid = (left + right) // 2
        if (mid, 0) < (x1, y1):
            left = mid + 1
        elif (mid, 0) > (x2, y2):
            right = mid
        else:
            left = mid + 1

    # Count the white regions within the rectangle.
    left, right = 0, W
    while left < right:
        mid = (left + right) // 2
        if (mid, 0) < (x1, y1):
            left = mid + 1
        elif (mid, 0) > (x2, y2):
            right = mid
        else:
            left = mid + 1

    return W * H - count_black_regions(x1, y1, x2, y2)


