    def move(tile1, tile2, board):
        if tile1 == tile2:
            if tile1 == 0:
                # do nothing
                return board
            else:
                # merge with other tile
                board[tile1 // 4][tile1 % 4] = tile1 * 2
                board[tile2 // 4][tile2 % 4] = tile1
        else:
            # move one tile to new position
            new_board = [[0] * 4 for _ in range(4)]
            new_board[tile1 // 4][tile1 % 4] = tile1
            new_board[tile2 // 4][tile2 % 4] = tile2
            # move other tile to new position
            new_board[tile1 // 4][tile1 % 4] = tile2
            new_board[tile2 // 4][tile2 % 4] = tile1
            # merge if same tile, move other tile to new position
            if tile1 == tile2 - 2:
                # merge left
                new_board[tile2 // 4][tile2 % 4] = tile2 // 2
            else:
                new_board[tile2 // 4][tile2 % 4] = tile2
            return new_board

    def merge(board):
        for i in range(4):
            for j in range(3):
                if board[i][j] == board[i][j + 1]:
                    # merge to the right
                    board[i][j] = board[i][j] * 2
                    board[i][j + 1] = 0
        for i in range(3):
