    m, n = list(map(int, stdin.strip().split()))
    grid = []
    for _ in range(n):
        grid.append(list(stdin.strip()))
    def spread_water():
        for i, line in enumerate(grid):
            for j, cell in enumerate(line):
                if cell == 'V':
                    for dx, dy in ((0, 1), (1, 0), (0, -1), (-1, 0)):
                        if i + dy < n and 0 <= j + dx < m and grid[i+dy][j+dx] == '.':
                            grid[i+dy][j+dx] = 'V'
    def get_water_in_next_second():
        water = []
        for i, line in enumerate(grid):
            for j, cell in enumerate(line):
                if cell == 'V':
                    water.append((i, j))
        for i, j in water:
            for dx, dy in ((1, 0), (-1, 0), (0, 1), (0, -1)):
                if i + dy < n and 0 <= j + dx < m and grid[i+dy][j+dx] == '.':
                    grid[i+dy][j+dx] = 'V'
    def get_grid_after_n_seconds():
        for _ in range(n):
            spread_water()
            get_water_in_next_second()
        for i, line in enumerate(grid):
            for j, cell in enumerate(line):
                if cell == 'V':
                    grid[i][j] = '.'
        return ''.join(''.join(line) for line in grid)
    return get_grid_after_n_seconds()

